import React, { Component } from "react";

class Clients extends Component {
  render() {
    const clients = [
      {
        id: 4494948449,
        firstName: "Jordan",
        lastName: "Lewin",
        email: "jordanl@kimo.com",
        phone: "444-444-5555",
        balance: 30
      }
    ];

    if (clients) {
      return (
        <div className="row">
          <div className="col-md-6">
            <i className="fas fa-users">Clients </i>
          </div>
        </div>
      );
    } else {
      return <h1>Loading...</h1>;
    }
  }
}

export default Clients;
